import { useState } from "react";
import SearchIcon from "../../Asstets/Icons/SearchIcon";
// import { MagnifyingGlassIcon, PencilIcon, UserPlusIcon } from "@heroicons/react/24/outline";

const TABS = [
  { label: "All", value: "all" },
//   { label: "Monitored", value: "monitored" },
//   { label: "Unmonitored", value: "unmonitored" },
];

const TABLE_HEAD = ["Member", "Function", "Status", "Employed", ""];

const TABLE_ROWS = [
  {
    img: "https://demos.creative-tim.com/test/corporate-ui-dashboard/assets/img/team-3.jpg",
    name: "John Michael",
    email: "john@creative-tim.com",
    job: "Manager",
    org: "Organization",
    online: true,
    date: "23/04/18",
  },
  {
    img: "https://demos.creative-tim.com/test/corporate-ui-dashboard/assets/img/team-2.jpg",
    name: "Alexa Liras",
    email: "alexa@creative-tim.com",
    job: "Developer",
    org: "Engineering",
    online: false,
    date: "23/04/18",
  },
  // Add more rows as needed
];

function ProductsTable() {
  const [selectedTab, setSelectedTab] = useState("all");
  const [search, setSearch] = useState("");

  return (
    <div className="w-full mx-auto my-8 p-4 bg-white shadow-md rounded-lg">
      <div className="mb-4 flex justify-between items-center">
        <div className=" text-left">
          <h2 className="text-xl font-semibold text-blue-gray-700">Product List</h2>
          <p className="text-sm text-gray-500">See information about all Product</p>
        </div>
        <div className="flex items-center space-x-2">
          <button className="px-4 py-2 text-sm font-semibold border border-gray rounded-md">View All Products</button>
          <button className="flex items-center px-4 py-2 text-sm font-semibold  bg-green text-white rounded-md">
             Add Product
          </button>
        </div>
      </div>
      <div className="flex items-center justify-between mb-4">
        <div className="flex space-x-4 ">
          {TABS.map((tab) => (
            <button
              key={tab.value}
              onClick={() => setSelectedTab(tab.value)}
              className={`py-2 px-4 font-medium ${selectedTab === tab.value ? "border-b-2 border-blue-500 text-blue-600" : "text-gray-500"}`}
            >
              {tab.label}
            </button>
          ))}
        </div>
        <div className="relative flex items-center">
          <input
            type="text"
            placeholder="Search"
            className="w-72 px-4 py-2 border rounded-md"
            value={search}
            onChange={(e) => setSearch(e.target.value)}
          />
          {/* <MagnifyingGlassIcon className="absolute top-3 right-3 h-5 w-5 text-gray-400" />
           */} <div>
            <SearchIcon/>
           </div>
        </div>
      </div>
      <table className="w-full table-auto text-left border-collapse">
        <thead>
          <tr>
            {TABLE_HEAD.map((head) => (
              <th key={head} className="border-b p-4 text-blue-gray-600 bg-deepGreen border border-light-gray font-medium">
                {head}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {TABLE_ROWS.map(({ img, name, email, job, org, online, date }, index) => (
            <tr key={name} className={" border border-light-gray"}>
                {/* index % 2 === 0 ? "bg-gray-400" :  */}
              <td className="p-4">
                <div className="flex items-center">
                  <img src={img} alt={name} className="w-8 h-8 rounded-full mr-3" />
                  <div>
                    <p className="font-medium">{name}</p>
                    <p className="text-sm text-gray-500">{email}</p>
                  </div>
                </div>
              </td>
              <td className="p-4">
                <p className="font-medium">{job}</p>
                <p className="text-sm text-gray-500">{org}</p>
              </td>
              <td className="p-4">
                <span
                  className={`px-2 py-1 text-xs rounded-full ${
                    online ? "bg-green-200 text-green-700" : "bg-gray-200 text-gray-700"
                  }`}
                >
                  {online ? "Online" : "Offline"}
                </span>
              </td>
              <td className="p-4 text-gray-500">{date}</td>
              <td className="p-4 flex gap-3 items-center justify-center">
                <button className="text-white bg-deepGreen px-2  rounded ">
                   Edit
                </button>
                <button className="text-white bg-gray  px-2  rounded">
                   Update
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="flex justify-between items-center mt-4">
        <p className="text-sm text-gray-500">Page 1 of 10</p>
        <div className="flex space-x-2">
          <button className="px-3 py-1 text-sm border rounded-md text-gray-600">Previous</button>
          <button className="px-3 py-1 text-sm border rounded-md text-gray-600">Next</button>
        </div>
      </div>
    </div>
  );
}

export default ProductsTable;
